package com.lanou.chenfengyao.okhttpdemo.ok3;

import android.os.Bundle;
import android.support.annotation.Nullable;
import android.support.v7.app.AppCompatActivity;
import android.util.Log;

import com.lanou.chenfengyao.okhttpdemo.R;

import java.io.IOException;

import okhttp3.MediaType;
import okhttp3.OkHttpClient;
import okhttp3.Request;
import okhttp3.RequestBody;
import okhttp3.Response;

/**
 * Created by ChenFengYao on 16/7/14.
 */
public class MainActivity extends AppCompatActivity {

    private OkHttpClient client;
    private String getUrl = "https://rong.36kr.com/api/mobi/roundpics/v4";
    public static final MediaType JSON
            = MediaType.parse("application/json; charset=utf-8");

    private String postUrl = "http://apis.baidu.com/idl_baidu/faceverifyservice/face_recognition";
    private String apiKey = "b915afe12f997bfa32f93016b37a025f";
    private String jsonBody = "{\n" +
            "\"params\": [\n" +
            "    {\n" +
            "      \"cmdid\":\"2002\",\n" +
            "      \"logid\": \"12345\",\n" +
            "      \"appid\": \"b915afe12f997bfa32f93016b37a025f\",\n" +
            "      \"clientip\":\"10.23.34.5\",\n" +
            "      \"type\":\"st_groupverify\",\n" +
            "      \"groupid\": \"0\",\n" +
            "      \"versionnum\": \"1.0.0.1\",\n" +
            "      \"images\": [\n" +
            "        \"\",\n" +
            "      ]\n" +
            "    }\n" +
            "  ],\n" +
            "  \"jsonrpc\": \"2.0\",\n" +
            "  \"method\": \"Verify\",\n" +
            "  \"id\":12\n" +
            "}";
    @Override
    protected void onCreate(@Nullable Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        client = new OkHttpClient();
        new Thread(new Runnable() {
            @Override
            public void run() {
                try {
//                    String s = httpRun(getUrl);
                    String s = post(postUrl,jsonBody);
                    Log.d("MainActivity", s);

                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        }).start();


    }

    String post(String url, String json) throws IOException {
        RequestBody body = RequestBody.create(JSON, json);
        Request request = new Request.Builder()
                .url(url)
                .post(body)
                .addHeader("apikey",apiKey)

                .build();
        Response response = client.newCall(request).execute();
        return response.body().string();
    }

    String httpRun(String url) throws IOException {
        Request request = new Request.Builder()
                .url(url)
                .build();

        Response response = client.newCall(request).execute();
        return response.body().string();
    }
}
